import Header from "../js/Header";
import styles from "../styles/Home.module.css";
import century from "../images/centuryBattery.jpg";
import { useNavigate } from "react-router-dom";

function Home() {
  const navigate = useNavigate();
  const requestNow = () => {
    navigate("/quote");
  };

  return (
    <div className={styles.body}>
      <div className={styles.intro}>
        <h1>
          Great Deals on <br></br>Century Car Batteries
        </h1>
        <img src={century}></img>
      </div>

      <div className={styles.request}>
        <label>Battery replacement services available</label>
        <button onClick={requestNow}>Send Enquiry</button>
      </div>

      <div className={styles.best}>
        <label>Best Sellers</label>
        <grid className={styles.productGrid}></grid>
      </div>
    </div>
  );
}

export default Home;
